import './Chat.css';
import React from 'react';

class Chat extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            people: []
        }
    }

    render() {
        return(
            <div className="">
                <div className='people'>
                    {this.state.people.map()}
                </div>
            </div>
        )
    }
}

export default Chat;
